  imageUrl: "https://i.imgur.com/aVqLAG7.png",
  description: "It's in the shed",
  liked: false,
  totalLikes: 200,
  totalComments: 20,
  user: {
    id: "user1",
    username: "AJ"
  }
}

// 3
export default {
  title: 'Post',
  component: Post,
}

const events = actions({ cardClicked: 'card clicked', likeClicked: 'like clicked', commentClicked: 'comment clicked' })


